import React , {Component} from 'react'

class Home extends Component {
    constructor(props){
        super(props)
    }
    render() {
        return(
            <div className='createSpace'>
                <br />
                <br />
                Each component has several “lifecycle methods” that you can override to run code 
                at particular times in the process. Here are some, commonly used lifecycle methods. 
                The rest of them exist for relatively rare use cases.


            </div>
        )
    }
}
export default Home
